import React from "react";
import LogoGather from "./LogoGather";
import "./index.css";

class LogoIcon extends React.Component {
  constructor(props) {
    super(props);
    this.defaultImage = {
      a:
        "data:image/png;base64,",
      b: "https://zos.alipayobjects.com/rmsportal/TOXWfHIUGHvZIyb.svg",
      c: "https://zos.alipayobjects.com/rmsportal/NbWTEbiswBhrRBU.svg"
    };
    this.state = {
      image: this.defaultImage.a,
      pixSize: 20,
      pointSize: 10,
      show: false
    };
  }

  onChangeImage = e => {
    const dom = e.target;
    this.image = dom.value;
  };

  onChangePix = num => {
    this.pixSize = num;
  };

  onClick = () => {
    if (this.image || this.pixSize || this.pointSize) {
      this.setState(
        prevState => {
          return {
            image: this.image || prevState.image,
            pixSize: typeof this.pixSize === "number" ? this.pixSize : prevState.pixSize,
            pointSize: typeof this.pointSize === "number" ? this.pointSize : prevState.pointSize,
            update: true
          };
        },
        () => {
          // 在第一个状态更新后，重置 'update' 状态
          this.setState({
            update: false
          });
        }
      );
    }
  };

  onChangeRadio = e => {
    const { target } = e;
    const { value } = target;
    this.image = this.defaultImage[value];
    this.setState({
      value
    });
  };

  onChangePoint = num => {
    this.pointSize = num;
  };

  phoneClick = () => {
    this.setState(prevState => {
      return {
        show: prevState.show
      };
    });
  };

  render() {
    return (
      <LogoGather
        update={this.state.update}
        value={this.state.value}
        image={this.state.image}
        pixSize={this.state.pixSize}
        pointSizeMin={this.state.pointSize}
        w={300}
        h={300}
      />
    );
  }
}

export default LogoIcon;
